import React from "react";
import "./SearchImage.scss";
import { withRouter } from "react-router-dom";

const SearchImage = ({ searchImageById }) => {
  return (
    <div className="searchimage">
      <span className='searchimage__title'>{searchImageById[0].data[0].title}</span>
      <img src={searchImageById[0].links[0].href} alt="searchimage" className='searchimage__img' />
      <span className='searchimage__desc'>{searchImageById[0].data[0].description}</span>
    </div>
  );
};

export default withRouter(SearchImage);
